DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '日志ID',
  `operation` varchar(255) NOT NULL COMMENT '被操作的对象',
  `way` varchar(200) NOT NULL COMMENT '方法名',
  `argument` varchar(1000) NOT NULL COMMENT '参数',
  `userid` varchar(20) NOT NULL COMMENT '操作人id',
  `name` varchar(50) NOT NULL COMMENT '操作人',
